import { Component, OnInit } from '@angular/core';
import { CommonModule } from '@angular/common';
import { RouterModule } from '@angular/router';
import { Observable } from 'rxjs';
import { ThemeService } from '../../../core/services/theme.service';

@Component({
  selector: 'app-header',
  standalone: true,
  imports: [CommonModule, RouterModule],
  template: `
    <nav class="navbar navbar-expand-lg navbar-light bg-primary-custom">
      <div class="container-fluid">
        <a class="navbar-brand d-flex align-items-center" routerLink="/">
          <i class="fas fa-plane-departure me-2"></i>
          <span>Cluster2 Airports</span>
          <small class="text-muted ms-2">News Dashboard</small>
        </a>

        <button 
          class="navbar-toggler" 
          type="button" 
          data-bs-toggle="collapse" 
          data-bs-target="#navbarNav"
          [attr.aria-expanded]="isCollapsed"
          aria-controls="navbarNav"
          aria-label="Toggle navigation"
          (click)="toggleNavbar()">
          <span class="navbar-toggler-icon"></span>
        </button>

        <div class="collapse navbar-collapse" id="navbarNav" [class.show]="!isCollapsed">
          <ul class="navbar-nav me-auto">
            <li class="nav-item">
              <a class="nav-link" routerLink="/" routerLinkActive="active" [routerLinkActiveOptions]="{exact: true}">
                <i class="fas fa-tachometer-alt me-1"></i>
                Dashboard
              </a>
            </li>
            <li class="nav-item dropdown">
              <a class="nav-link dropdown-toggle" href="#" role="button" data-bs-toggle="dropdown" aria-expanded="false">
                <i class="fas fa-newspaper me-1"></i>
                News
              </a>
              <ul class="dropdown-menu">
                <li><a class="dropdown-item" routerLink="/news">All News</a></li>
                <li><a class="dropdown-item" routerLink="/news/create">Add News</a></li>
                <li><hr class="dropdown-divider"></li>
                <li><a class="dropdown-item" routerLink="/news" [queryParams]="{archived: true}">Archived</a></li>
              </ul>
            </li>
            <li class="nav-item">
              <a class="nav-link" routerLink="/users" routerLinkActive="active">
                <i class="fas fa-users me-1"></i>
                Users
              </a>
            </li>
          </ul>

          <div class="d-flex align-items-center">
            <button 
              class="theme-toggle me-3" 
              (click)="toggleTheme()"
              [title]="(isDarkMode$ | async) ? 'Switch to Light Mode' : 'Switch to Dark Mode'">
              <i class="fas" [class.fa-sun]="isDarkMode$ | async" [class.fa-moon]="!(isDarkMode$ | async)"></i>
            </button>

            <div class="dropdown">
              <button class="btn btn-outline-primary dropdown-toggle" type="button" data-bs-toggle="dropdown">
                <i class="fas fa-user me-1"></i>
                Admin
              </button>
              <ul class="dropdown-menu dropdown-menu-end">
                <li><a class="dropdown-item" href="#"><i class="fas fa-user-cog me-2"></i>Profile</a></li>
                <li><a class="dropdown-item" href="#"><i class="fas fa-cog me-2"></i>Settings</a></li>
                <li><hr class="dropdown-divider"></li>
                <li><a class="dropdown-item" href="#"><i class="fas fa-sign-out-alt me-2"></i>Logout</a></li>
              </ul>
            </div>
          </div>
        </div>
      </div>
    </nav>
  `,
  styles: [`
    .navbar-brand {
      font-weight: 600;
    }

    .navbar-brand small {
      font-size: 0.75rem;
    }

    .theme-toggle {
      background: none;
      border: none;
      font-size: 1.25rem;
      cursor: pointer;
    }

    .theme-toggle:hover {
      color: #0d6efd;
    }

    .dropdown-toggle {
      padding: 0.25rem 0.75rem;
    }

    .dropdown-menu {
      min-width: 200px;
    }

    .dropdown-item {
      padding: 0.5rem 1rem;
    }

    .dropdown-item i {
      width: 1.25rem;
      text-align: center;
    }
  `]
})
export class HeaderComponent implements OnInit {
  isCollapsed = true;
  isDarkMode$: Observable<boolean>;

  constructor(private themeService: ThemeService) {
    this.isDarkMode$ = this.themeService.isDarkMode();
  }

  ngOnInit() {}

  toggleNavbar(): void {
    this.isCollapsed = !this.isCollapsed;
  }

  toggleTheme(): void {
    this.themeService.toggleTheme();
  }
}
